import React, { Component } from 'react';

class Card extends Component {
    constructor(model) {
        super();
        this.state = {
            item: model
        };
    }
    render() {
        return (
            <div className="Card">
                <p>{ this.state.item }</p>
            </div>
        );
    }
}

export default Card;
